import React from "react";
import { Route, BrowserRouter, Routes } from "react-router-dom";
import Listeencheres from "./components/Listeencheres";
import Historique from './components/Historique';
import Ficheenchere from './components/Ficheenchere';
import Formulaire from './components/Formulaire';



function App({ children }) {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path='/' element={Listeencheres} exact></Route>
          <Route path='/historique' element={Historique} exact></Route>
          <Route path='/listeenchere' element={Listeencheres} exact></Route>
          <Route path='/ficheenchere' element={Ficheenchere} exact></Route>
          <Route path="/formulaire" element={Formulaire} exact></Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
};

export default App;
